import { Container, CssBaseline, Paper, ThemeProvider, createMuiTheme } from "@material-ui/core";
import HomeScreen from "./screens/HomeScreen";

const theme = createMuiTheme({
  typography: {
    h1: { fontWeight: 'bold' },
    h2: {
      fontSize: '2rem',
      color: 'black',
    },
    h3: {
      fontSize: '1.8rem',
      fontWeight: 'bold',
      color: 'white',
    },
  },
  palette: {
    primary: { main: '#ff1744' },
    secondary: {
      main: '#118e16',
      contrastText: '#ffffff',
    },
  },
});

function App() {
  return (
   <ThemeProvider theme = {theme}>
    <CssBaseline />
    <Container maxWidth = "sm"></Container>
    <Paper>
      <HomeScreen>

      </HomeScreen>
    </Paper>
   </ThemeProvider>
  );
}

export default App;
